import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    buttonSkill:{
        backgroundColor: "#1F1E25",
        padding: 15,
        borderRadius: 50,
        alignItems: "center",
        marginVertical: 10
    },
    textSkill:{
        color: "#FFF",
        fontSize: 22,
        fontWeight: "bold",
    }
})

export default styles
